import React from 'react';

export function About() {
    return (
        <div>
            <article>
                <h2>Acerca de Journaling Deco</h2>
                <p>En J.D. podras encontrar una gran variedad de productos en areas como: Bloc de notas, Cartucheras, Stickers, Piezas de Papeleria, Deco Escritorio y Pulmones #SHORTEN WHEN FILETERS ARE READY#.</p>
                <p>Podes encontrarnos en Canelones, en la ciudad de Barrios Blancos, ruta 8, km 27, en la calle Homero, solar 12.</p>
                <p>#INSERT GOOGLE MAPS LINK#</p>
            </article>
        </div>
    );
}

export function Products() {
    return (
        <div>
            <article>
                <h2>Productos</h2>
                <p>Aqui encontraras nuestros productos donde podras filtrar por seccion!</p>
                <p>#ADD PRODUCTS CARDS, NAME, PRICE, SECTION#</p>
	        <p>#ADD SECTION FILTERING#</p>

            </article>
        </div>
    );
}
